    "hydrology-ecology-study-proposed-for-the-great-dismal-swamp-national-wildlife-refuge-1978",nt"isopen":
    false,nt"url": null,nt"notes": "This is a proposal and brief outline of
    a hydrology/ecology project to be done at the Great Dismal Swamp National Wildlife
    Refuge. Its objectives are: 1) to examine the interrelationship of vegetation, soils
    and hydrology at selected sites within the swamp, 2) to characterize the western
    transition zone of the swamp, 3) to identify species or species associations that
    may serve as indicators of soil type or hydrology and 4) to study the ground water-surface
    water relationship in a few selected sites where vegetation suggests that unusual
    hydrologic conditions may exist.",nt"license_title": "License Not Specified",nt"extras":
